entity.p:
South Tottenham is a railway station on the east-west Gospel Oak to Barking Line of the London Overground. It is located on the eastern side of the north-south A10 High Road in Tottenham, North London, 5 miles 69 chains (9.4 km) from St Pancras (measured via Kentish Town and Mortimer Street Junction)[4] and situated between Harringay Green Lanes and Blackhorse Road. It is in Zone 3, in the London Borough of Haringey.
South Tottenham to Seven Sisters station (on the western, Seven Sisters Branch of the Lea Valley Lines and on the London Underground Victoria line) is considered an official out-of-station interchange by the National Rail timetable, and involves a short walk. This link will become fixed under the planned route for Crossrail 2, which sees a double-ended underground station built linking together South Tottenham and Seven Sisters stations.[5]
